import Rest from './rest'
import state from './state'

class Session{
	constructor(){}

	yaala(from, data){
		this.rest.yaala({from, data})
	}

	yoole(from, to, data){
		this.rest.yoole({from, to, data})
	}


	connect(path){
		let source = new EventSource(path)
		source.addEventListener('message', msg => this.onMessage(msg.data) )
	}

	onMessage(data){
		try{
			let msg = JSON.parse(data)
			switch(msg.id){
				case 'welcome' : this.onWelcome(msg); break;
				case 'yaala' : this.onYaala(msg); break;
				case 'yoole' : this.onYoole(msg); break;
			}
		}catch(e){
			console.log(e)
		}
	}

	onWelcome(msg){}

	onYoole(msg){
		console.log('yoole', msg)
	}

	onYaala(msg){
		console.log('yaala', msg)
	}

	async initialize(initialized ){
		this.rest = new Rest()
		let config = await this.loadConfig()

		this.state.ok = config.ok

		if (this.state.ok){
			this.state.system.region = config.data.region
			this.state.system.copyright = config.data.copyright
		}

		this.connect('/goyaala')

		initialized( this )
	}

	async loadConfig(){
		return await this.rest.config()
	}

}

class Model extends Session{
	constructor( initialized ){
		super()
		this.state = state

		this.initialize( initialized )
	}

	onWelcome(msg){

		this.state.user.token = msg.data

		console.log('welcome!!', this.state.user.token)

		this.notify(msg.timestamp, 'token')
	}

	onYoole(msg){
		let data = msg.data

		let item = { from: data.from, hits: data.body.hits }

		if ( this.state.user.yaala.response.length < this.state.user.setting.yaala.response.max){
			this.state.user.yaala.response.push(item)
			this.notify(data.timestamp, 'yoole')
		}
	}

	onYaala(msg){
		let data = msg.data
		let item = { from: data.from, criteria: data.body, hits: this.search(data.body) }

		if (this.state.user.yoole.request.length < this.state.user.setting.yoole.request.max){
			this.state.user.yoole.request.push(item)

			let response = {channel: msg.channel, criteria: item.criteria, hits: item.hits}
			this.yoole(this.state.user.token, data.from, response)

			this.notify(msg.timestamp, 'yaala')
		}
	}


	notify(data, id){
		this.onUpdate && this.onUpdate(data, id)
	}

	//methods
	search(list){
		return this.state.user.yoole.list.filter(item => list.indexOf(item) >= 0)
	}

	update(data, id){
		switch(id){
			case 'yaala' : this.updateYaala(data); break;
			case 'yoole' : this.updateYoole(data); break;
			case 'app' : this.updateApp(data); break;
			case 'setting' : this.updateSetting(data); break;
	 	}
	}

	updateYaala(info){
		if (info.id === 'list'){
			this.state.user.yaala.list = info.data
			this.yaala(this.state.user.token, info.data)
		}else{
			this.state.user.yaala.response = info.data
			this.notify(Date.now(), 'yaala-response')
		}

	}

	updateYoole(info){
		if (info.id === 'list')
			this.state.user.yoole.list = info.data
		else
			this.state.user.yoole.response = info.data

		this.notify(Date.now(), 'yoole-' + info.id)
	}

	updateApp(data){
		console.log('updateApp', data)
	}

	updateSetting(data){
		console.log('updateSetting', data)
	}

	replyYoole(data){
		this.yoole(this.state.user.token, data.to,  data.list)
	}


}

export default Model
